<!DOCTYPE html>
<html>
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <title>Paiement CinetPay - Guinée</title>
    <!-- 1) IMPORTATION DU SDK SEAMLESS -->
    <script src="https://cdn.cinetpay.com/seamless/main.js"></script>
    <style>
        body {
            font-family: Arial, sans-serif;
            padding: 20px;
            margin: 0; /* Important pour le positionnement de la notif */
        }
        .sdk {
            display: block;
            position: absolute;
            background-position: center;
            text-align: center;
            left: 50%;
            top: 50%;
            transform: translate(-50%, -50%);
            border: 1px solid #ccc;
            padding: 30px;
            border-radius: 8px;
            box-shadow: 0 4px 8px rgba(0,0,0,0.1);
        }
        button {
            padding: 10px 20px;
            font-size: 16px;
            cursor: pointer;
            background-color: #4CAF50;
            color: white;
            border: none;
            border-radius: 4px;
            margin-top: 15px;
        }
        button:hover {
            background-color: #45a049;
        }
        h1 {
            font-size: 20px;
            margin-bottom: 20px;
        }

        /* --- Style pour la notification flottante --- */
        #notification-banner {
            position: fixed; /* Reste visible même si on scrolle */
            top: 0;
            left: 0;
            width: 100%;
            padding: 15px 20px;
            box-sizing: border-box; /* Inclut padding dans la largeur */
            text-align: center;
            font-size: 16px;
            font-weight: bold;
            color: white;
            z-index: 1000; /* Au-dessus des autres éléments */
            display: none; /* Cachée par défaut */
            transition: transform 0.5s ease-in-out; /* Animation douce */
            transform: translateY(-100%); /* Position initiale hors écran */
        }
        #notification-banner.show {
            display: block;
            transform: translateY(0); /* Glisse vers le bas pour être visible */
        }
        #notification-banner.success {
            background-color: #4CAF50; /* Vert pour succès */
        }
        #notification-banner.error {
            background-color: #f44336; /* Rouge pour échec */
        }
        #notification-banner .close-btn {
            position: absolute;
            top: 50%;
            right: 20px;
            transform: translateY(-50%);
            font-size: 20px;
            cursor: pointer;
            font-weight: bold;
        }
         /* --- Fin Style Notification --- */

    </style>
</head>
<body>
    <!-- Élément pour la notification flottante -->
    <div id="notification-banner" role="alert">
        <span id="notification-message"></span>
        <span class="close-btn" onclick="hideNotification()">×</span>
    </div>

    <div class="sdk">
        <h1>Paiement CinetPay (GNF)</h1>
        <!-- 2) CREATION DU FORMULAIRE (ici, un simple bouton déclencheur) -->
        <button onclick="checkout()">Payer 1000 GNF</button>
    </div>
